import React from 'react'

import { useFormik } from 'formik'

import {
    Button,
    Radio,
    RadioGroup,
    FormControlLabel,
    FormControl,
    FormLabel
} from '@mui/material'

const SomeQuestions = () => {

    const formik = useFormik({
        initialValues: {
            part_of_complex: '',
            is_existing_complex: '',
            introduction: {
                existing_complex_name: '',
                residence_type: '',
                vhe_type: ''
            }
        },
        /* validationSchema: validationSchema, */
        onSubmit: (values) => {
            console.log(values)
        }
    })

    return (
        <>
            <div>
                <form onSubmit={formik.handleSubmit}>

                    {/* EXISTING COMPLEX */}
                    <FormControl component='fieldset'>
                        <FormLabel component='legend' style={{ color: 'black'}}>Is the residence part of a complex?</FormLabel>
                        <RadioGroup
                            onChange={formik.handleChange}
                            name='part_of_complex'
                            value={formik.values.part_of_complex}
                        >
                            <FormControlLabel
                                value='true'
                                control={<Radio />}
                                label='True'
                            />
                            <FormControlLabel
                                value='false'
                                control={<Radio />}
                                label='False'
                            />
                        </RadioGroup>
                    </FormControl>

{/* EXISTING COMPLEX */}
<FormControl component='fieldset'>
    <FormLabel component='legend' style={{ color: 'black'}}>Is the residence part of a complex?</FormLabel>
    <RadioGroup
        onChange={formik.handleChange}
        name='part_of_complex'
        value={formik.values.part_of_complex}
    >
        <FormControlLabel
            value='true'
            control={<Radio />}
            label='True'
        />
        <FormControlLabel
            value='false'
            control={<Radio />}
            label='False'
        />
    </RadioGroup>
</FormControl>

                    <Button color='primary' variant='contained' fullWidth type='submit'>
                        Submit
                    </Button>
                </form>
            </div>
        </>
    )
}

export default SomeQuestions
